import React from "react";

const Introduction = () => {
  return (
    <div className="intro-container">
      <p>Hello, i'm Daniel Ojeda</p>
      <p>I'm a web developer</p>
      <p>living in San francisco</p>
    </div>
  );
};

export default Introduction;
